            title: "Titulo 3",
            dato: 90,
            icon: "fa-user"
        },
    ]
    return(
        <section className="top-data">
            {
                fichasData.map((ficha, index) => 
                <Ficha key={ficha.title + indx} title = {ficha.title} dato = {ficha.dato} icon = {ficha.icon}  />)
            }
        </section>
    )
}
export default FichaGrid
